import React, { Component } from 'react'

export default class Header extends Component {
    render() {
        return (
            <div>
                <header style={HeaderStyle}>
                    welcom to userform
                </header>
            </div>
        )
    }
}

const HeaderStyle={
    background:"red",
    textTransform:"capitalise"
}
